rs in XML mode</li>\n<li>bug fix: \'Ignore empty rows\' doesn\'t ignore empty rows</li>\n<li>bug fix: repeater sub fields not saved in ACF 4.x</li>\n<li>bug fix: unable to set relationship fields when post type is not defined for related content</li>\n<li>bug fix: unable to import taxonomy fields inside repeater fields</li>\n</ul>\n<p>3.1.6</p>\n<ul>\n<li>improvement: added support for link field</li>\n<li>improvement: added support for Font Awesome Icon field</li>\n<li>improvement: added support for range field</li>\n<li>improvement: added support for button_group field</li>\n<li>improvement: render acf groups alphabetically</li>\n<li>bug fix: import post object filed based on acf post type settings</li>\n<li>bug fix: updating acf when update option disabled</li>\n<li>bug fix: added wp_all_import_images_uploads_dir filter</li>\n<li>bug fix: rendering ACF local fields</li>\n<li>bug fix: import relationship field based on custom types in field settings</li>\n</ul>\n<p>3.1.5</p>\n<ul>\n<li>bug fix: import post object field</li>\n<li>bug fix: matching relationship posts</li>\n<li>bug fix: using google maps api key</li>\n<li>bug fix: import clone group field</li>\n<li>bug fix: date time picker format</li>\n<li>bug fix: import empty image field in repeater</li>\n</ul>\n<p>3.1.4</p>\n<ul>\n<li>improvement: performance optimization</li>\n<li>improvement: added support for Vimeo field type</li>\n<li>bug fix: search for existing files</li>\n<li>bug fix: import images into File field</li>\n<li>bug fix: import relationship inside repeater</li>\n</ul>\n<p>3.1.3</p>\n<ul>\n<li>improvement: added support for new ACF field \'Google Map Extended\'</li>\n<li>bug fix: import ACF repeater in fixed mode</li>\n<li>bug fix: saving ACF taxonomy import template</li>\n<li>bug fix: leave these ACF fields alone, update all other ACF fields</li>\n<li>bug fix: import ACF to taxonomies</li>\n<li>bug fix: saving ACF select field</li>\n</ul>\n<p>3.1.2</p>\n<ul>\n<li>improvement: compatibility with PHP 7.x</li>\n<li>improvement: new field type \'time picker\'</li>\n<li>improvement: new delimiter option for relationship fields</li>\n<li>bug fix: rendering repeater field inside flexible field in case when ACF configuration presented in functions.php file</li>\n<li>bug fix: import 0 value for number field inside repeater</li>\n</ul>\n<p>3.1.1</p>\n<ul>\n<li>improvement: support for clone field</li>\n<li>improvement: new option \'only append new images to the gallery\'</li>\n<li>improvement: new filter pmxi_acf_custom_field</li>\n<li>bug fix: flexible field JS conflict</li>\n<li>bug fix: search for existing image in media gallery</li>\n<li>bug fix: import ACF taxonomies to users</li>\n<li>bug fix: conflict between updating custom fields and ACF</li>\n<li>bug fix: acf grops duplicates</li>\n<li>bug fix: compatibility with php 7</li>\n<li>bug fix: import repeater in repeater for CSV mode</li>\n</ul>\n<p>3.1.0</p>\n<ul>\n<li>fixed ignore blank rows for fixed repeater mode</li>\n<li>fixed import taxonomy field</li>\n<li>fixed import multiple checkbox field in csv repeater mode</li>\n<li>added a \'Search through Media Library\' checkbox for each image field</li>\n<li>added geocode API settings to map field</li>\n</ul>\n<p>3.0.9</p>\n<ul>\n<li>fixed repeater field ( Variable mode XML )</li>\n</ul>\n<p>3.0.8</p>\n<ul>\n<li>fixed import taxonomy field</li>\n<li>fixed search for existing images is case when there are a few files with the same name in database</li>\n</ul>\n<p>3.0.7</p>\n<ul>\n<li>fixed import empty gallery field</li>\n</ul>\n<p>3.0.6</p>\n<ul>\n<li>added a separator option for gallery field</li>\n<li>fixed excessive update requests</li>\n</ul>\n<p>3.0.5</p>\n<ul>\n<li>fixed import field type file</li>\n<li>fixed loading import template</li>\n<li>fixed link to repeater field documentation</li>\n<li>fixed import relationship fields</li>\n</ul>\n<p>3.0.4</p>\n<ul>\n<li>fixed import mapped acf for 5.x version</li>\n<li>improved security</li>\n</ul>\n<p>3.0.3</p>\n<ul>\n<li>fixed import ACF for users</li>\n<li>fixed import image &amp; file fields ( searching image in attachments before download )</li>\n<li>added flexible content field</li>\n</ul>\n<p>3.0.2</p>\n<ul>\n<li>fixed conflict between repeater and taxonomy</li>\n<li>added support validated_field type</li>\n</ul>\n<p>3.0.1</p>\n<ul>\n<li>fixed call to non existing object property php error</li>\n<li>changed main plugin file name</li>\n</ul>\n<p>3.0.0</p>\n<ul>\n<li>New Advanced Custom Fields Add-On for WP All Import 4.0. Works with both ACF4 and ACF5/Pro. Learn more about WP All Import 4.0 at http://www.wpallimport.com/2014/11/introducing-wp-all-import-4-0/</li>\n</ul>\n<p>2.0.1</p>\n<ul>\n<li>Compatibility with ACF 5.0.0</li>\n</ul>\n<p>1.0.0</p>\n<ul>\n<li>fixed import images</li>\n<li>fixed session issue</li>\n<li>fixed data picker</li>\n</ul>\n<p>0.9.7</p>\n<ul>\n<li>fixed: php notices</li>\n<li>fixed: import taxonomies field</li>\n<li>fixed: import file field</li>\n<li>added: new option \"update only mapped ACF\"</li>\n<li>added: possibility to update repeater sub fields in re-import section</li>\n</ul>\n<p>0.9.6</p>\n<ul>\n<li>fixed: sanitizing file names</li>\n<li>fixed: load options template</li>\n<li>fixed: php warnings</li>\n</ul>\n<p>0.9.5</p>\n<ul>\n<li>fixed: php notices</li>\n<li>fixed: import repeater field</li>\n<li>fixed: js errors in taxonomies field</li>\n</ul>\n\";}s:7:\"banners\";a:2:{s:4:\"high\";s:0:\"\";s:3:\"low\";s:0:\"\";}}', 'no'),
