(4286, 'wpai-woocommerce-add-on_080fdc82a3a678dab2d4f10c27ddeb79', 'O:8:\"stdClass\":11:{s:11:\"new_version\";s:5:\"3.0.4\";s:14:\"stable_version\";s:5:\"3.0.4\";s:4:\"name\";s:18:\"WooCommerce Add-On\";s:4:\"slug\";s:23:\"wpai-woocommerce-add-on\";s:3:\"url\";s:65:\"http://www.wpallimport.com/downloads/woocommerce-add/?changelog=1\";s:12:\"last_updated\";s:19:\"2018-05-27 11:41:57\";s:8:\"homepage\";s:53:\"http://www.wpallimport.com/downloads/woocommerce-add/\";s:7:\"package\";s:179:\"http://www.wpallimport.com/edd-sl/package_download/MTU3MDE0MzAxOTowOjE1Mjk6OWIzNTc3MzQ2MGJmMjE2N2FjMTI4MjVhM2JiZGRiMTE6aHR0cHNALy9lZGVydG9uLnh5ei9wcmV2aWV3L20yZGlzdHJpYnVpZG9yYTow\";s:13:\"download_link\";s:179:\"http://www.wpallimport.com/edd-sl/package_download/MTU3MDE0MzAxOTowOjE1Mjk6OWIzNTc3MzQ2MGJmMjE2N2FjMTI4MjVhM2JiZGRiMTE6aHR0cHNALy9lZGVydG9uLnh5ei9wcmV2aWV3L20yZGlzdHJpYnVpZG9yYTow\";s:8:\"sections\";a:2:{s:11:\"description\";s:90:\"<p>Support for unlimited sites</p>\n<p>Lifetime e-mail support</p>\n<p>Lifetime updates</p>\n\";s:9:\"changelog\";s:13948:\"<p>3.0.4</p>\n<ul>\n<li>bug fix: import shipping class</li>\n<li>bug fix: adjust empty prices</li>\n<li>bug fix: import attributes with non utf-8 characters</li>\n<li>bug fix: import stock quantity for variable products ( variations are children in XML file )</li>\n</ul>\n<p>3.0.3</p>\n<ul>\n<li>bug fix: PHP 5.4 compatibility - fixed \"can\'t use method return value in write context\" error</li>\n<li>bug fix: assing attributes marked as not in variation to parent product</li>\n</ul>\n<p>3.0.2</p>\n<ul>\n<li>bug fix: import attributes marked as not in variation</li>\n<li>bug fix: import attributes with reserved term names </li>\n</ul>\n<p>3.0.1</p>\n<ul>\n<li>bug fix: PHP 7.0 compatibility</li>\n<li>bug fix: sanitize variation attribute names</li>\n<li>bug fix: deleting SKUs during mport with manual records matching enabled</li>\n</ul>\n<p>3.0.0</p>\n<ul>\n<li>improvement: refactored codebase</li>\n<li>improvement: speed up import variable products</li>\n<li>improvement: sync variable product with variations</li>\n<li>bug fix: do not add featured image to the gallery</li>\n<li>bug fix: updating existing products by post ID</li>\n<li>bug fix: adjust prices for variable product imported via option 5</li>\n<li>bug fix: import order notes date</li>\n<li>bug fix: import order refunds date</li>\n<li>bug fix: import order payment method</li>\n<li>bug fix: generate order_key during import orders</li>\n</ul>\n<p>2.4.1</p>\n<ul>\n<li>bug fix: import attributes with special characters</li>\n<li>bug fix: recount product terms when updating post status</li>\n</ul>\n<p>2.4.0</p>\n<ul>\n<li>bug fix: stock status not importing properly when _backorders custom field is not set</li>\n<li>bug fix: product dimensions won\'t import if \'Virtual\' field is not set</li>\n<li>bug fix: compatibility fix WooCommerce 2.6.x</li>\n<li>bug fix: options conflict when creating simple products</li>\n<li>bug fix: remove deprecated function calls for PHP 7.2 compatibility</li>\n<li>bug fix: unable to import 0 as a value for attributes</li>\n<li>bug fix: mirror new WooCommerce core behavior that forces all uncategorized products to be assigned to the Uncategorized category</li>\n<li>bug fix: custom fields not imported to all product variations</li>\n<li>bug fix: stock status not set to outofstock when stock value set to 0 for some product variation imports</li>\n<li>bug fix: \'Stock Quantity\' field not visible for some product variation imports</li>\n<li>bug fix: unable to set \'Catalog visibility\' to \'Search results only\' for External/Affiliate products</li>\n<li>bug fix: unable to import additional variation images for some product variation imports</li>\n<li>bug fix: variable products not imported as simple products when only one variation is imported</li>\n</ul>\n<p>2.3.9</p>\n<ul>\n<li>bug fix: make product simple options when missing variation deleted</li>\n<li>bug fix: set missing records out of stock for link all variations</li>\n<li>bug fix: matching linked products</li>\n<li>bug fix: link all variations - set custom fields for missing records</li>\n<li>bug fix: setting order tax items via xpath</li>\n</ul>\n<p>2.3.9</p>\n<ul>\n<li>bug fix: make product simple options when missing variation deleted</li>\n<li>bug fix: set missing records out of stock for link all variations</li>\n<li>bug fix: matching linked products</li>\n<li>bug fix: link all variations - set custom fields for missing records</li>\n<li>bug fix: setting order tax items via xpath</li>\n</ul>\n<p>2.3.8</p>\n<ul>\n<li>improvement: added new filter wp_all_import_recount_terms_after_import</li>\n<li>improvement: Allow add variations as linked products</li>\n<li>bug fix: compatibility with woo commerce 2.6</li>\n<li>bug fix: error on activation without WP All Import</li>\n<li>bug fix: grouping variable products</li>\n<li>bug fix: Set parent product outofstock if all variations are outofstock</li>\n<li>bug fix: import stock status for 5th type of import variable products</li>\n<li>bug fix: do not update stock_status if _stock is not set to update</li>\n</ul>\n<p>2.3.7</p>\n<ul>\n<li>improvement: added \'WooCommerce Advanced Options\' to re-import section</li>\n<li>bug fix: variations title</li>\n<li>bug fix: import first variation image</li>\n<li>bug fix: send order emails after custom fields were imported</li>\n<li>bug fix: updating featured product status</li>\n<li>bug fix: WPML & link all variations option conflict</li>\n<li>bug fix: add _price field for each variation</li>\n<li>bug fix: terms re-count</li>\n</ul>\n<p>2.3.6</p>\n<ul>\n<li>improvement: new option \'Parent SKU\' for variable products types 2 & 4</li>\n<li>improvement: new action wp_all_import_make_product_simple</li>\n<li>bug fix: import _order_tax</li>\n<li>bug fix: detecting duplicate SKUs</li>\n<li>bug fix: import product visibility WC 3.0</li>\n<li>bug fix: stock threshold</li>\n<li>bug fix: title for first variation</li>\n<li>bug fix: import non latin attributes</li>\n</ul>\n<p>2.3.5</p>\n<ul>\n<li>improvement: add japanese translations</li>\n<li>improvement: compatibility with WC 3.0</li>\n<li>bug fix: import _tax_class</li>\n<li>bug fix: remove orphaned attributes relationships</li>\n<li>bug fix: import order taxes</li>\n</ul>\n<p>2.3.4</p>\n<ul>\n<li>bug fix: import reserved attributes</li>\n<li>bug fix: updating product gallery</li>\n<li>bug fix: WooCommerce reports when importing orders</li>\n</ul>\n<p>2.3.3</p>\n<ul>\n<li>improvement: compatibility PHP 7.x</li>\n<li>improvement: new filter \'wp_all_import_variation_taxonomies\' to control variation taxonomies</li>\n</ul>\n<p>2.3.2</p>\n<ul>\n<li>improvement: customer matching in order imports</li>\n<li>improvement: added ACF to re-import options</li>\n<li>bug fix: term recount for 5th type of import variable products INSERT INTO `wp_options` (`option_id`, `option_name`, `option_value`, `autoload`) VALUES
